import React from "react";
import "../styles/Contact";

const About = () => {
    return (
        <div className="Contact modules">
            <div className="card">
                <h2>0633191067</h2>
                <h2>claretdamien@gmail.com</h2>
            </div>
            <div className="contactInputs"></div>
        </div>
    );
};

export default About;
